import Nav from "../components/Nav";
import SearchBox from "../components/SearchBox";

const SearchScreen = (props) => {
    return ( 
        <>
            <Nav tabs={props.tabs}/>
            <div className="w-50">
            <SearchBox />
            </div>
        </>
     );
}
 
export default SearchScreen;
